PROTECTED STRUCTURE: Planning Permission is sought by Crosswaithe Developments Ltd for development on lands at 'Verville Retreat' (A Protected Structure, Ref. 8202), Vernon Avenue, Clontarf, Dublin 3. The development will consist of the provision of 12 no. residential units, the conversion of the existing outbuilding into 1 no. mews dwelling and the conversion of the existing Verville Retreat building into 6 no. apartments (19 no. residential units are proposed in total for the development) consisting of the following: (a) Refurbishment of the existing Verville Retreat (a Protected Structure, Ref. 8202) and it's change of use from a nursing home to now provide for 6 no. apartments (consisting of 2 no. 1 bed; 1 no. 2 bed; and 3 no. 3 bed apartments) across basement to second floor level; (b) Internal alterations and demolition of later additions and extensions to the existing Verville Retreat building (a Protected Structure, Ref. 8202) in order to accommodate the provision of the new apartment units;(c) Refurbishment of the existing outbuilding (within the curtilage of Protected Structure Ref. 8202) and its conversion to 1 no. 2 bed single storey mews dwelling; (d) The demolition of the existing outbuilding to the North of Verville Retreat; (e) Construction of 4 no. 3 bed (with office/lounge), 3 storey terraced houses along Vernon Avenue to the north of Verville Retreat. 
These dwellings shall have a roof garden to both their front and rear elevations at first floor level; (f) Construction of 4 no. 4 bed  (with study), 3 storey detached dwellings to the south east of Verville Retreat. These dwellings shall have a terrace to their front elevation at first floor level; (g) Construction of 4 no. 3 bed (with study/playroom), 3 storey semi-detached dwellings to the south west of Verville Retreat. These dwellings shall have a terrace at first floor level to their east elevation; (h) The provision of 23 no. surface level car parking spaces; (i) Reduction to the height of the existing northern boundary wall and the provision of 4 no. gated pedestrian openings along the existing northern boundary to serve the 4 no. proposed dwellings along Vernon Avenue;
(j) and all associated landscaping, boundary treatment, engineering and site development works necessary to facilitate the development.

