- Provision of family bathroom at first floor level;
- Repair and refurbishment of windows and rainwater goods;
- The fitting of gates to the existing front vehicular entrance and all ancillary and associated works.

PROTECTED STRUCTURE: Planning permission in relation to development at Numbers 91 and 92 Camden Street Lower, Dublin 2 and Numbers 1, 2 and 3 Camden Row, Dublin 8. Nos 91 and 92 Camden Street Lower and Nos 1 and 2 Camden Row are protected structures. Ryan's Public House currently occupies the ground floor of No 92 Camden Street Lower, and Nos 1 and 2 Camden Row. The proposed development comprises of the following: 

(i) No.91 Camden Street Lower - Ground Floor: Change of use of the existing retail use to use as restaurant/cafe (42 sq.m) and refurbishment works to the interior of the ground floor of No. 91 Camden Street Lower. Refurbishment works to the buildings to the rear of No.91 with the provision of a covered seating area (23.6 sq.m), glazed lobby, and shared kitchen facilities for the proposed restaurant/cafe and adjacent public house at No. 92 Camden Street Lower and No. 1& 2 Camden Row including installation of a server hatch to the adjoining public house at number 1 and 2 Camden Row; and provision of shared WC facilities to the rear for use by the proposed restaurant/cafe and adjoining public house;

(ii) No.91 Camden Street Lower - first floor level: refurbishment works including amending internal walls and doors to facilitate an office use at this location, provision of WC facilities at first floor level of the buildings to the rear of Number 91; 

(iii) The proposed development includes the works to the roof of No.91 Camden Street as required by conditions attached to Reg. Ref: 3512/13; 

(iv) Part-demolition of the remains of a derelict two storey outhouse building to the rear of No.91 Camden Street Lower; 

(v) No.92 Camden Street Lower and No's 1 and 2 Camden Row (Ryan's Public House) - Ground Floor: Refurbishment works to the existing public house including removal of WC; amendments to internal walls/partitions; removal of non historic stair access to first floor level of No. 1 Camden Row; and replacement of non historic stair access to first floor level with access from Camden Row; 

(vi) No. 92 Camden Street Lower and No. 1 and 2 Camden Row - Upper Floors: At first floor level, refurbishment and minor amendments to internal layout of residential unit at No. 92 Camden Street Lower; part-removal of existing first floor at Nos 1&2 Camden Row to create a double height space at ground floor level; and provision of new staircase to residential unit at second floor level. Refurbishment works at second floor level of No. 1&2 Camden Row; 

(vii) No. 3 Camden Row: Removal of non original roof to No. 3 Camden Row and the provision of new glazed roof, creating a semi-external seating space for Ryan's Public House, and the restoration of historic openings onto Camden Row; 

(viii) Elevational amendments to No. 92 Camden Street Lower and Nos 1,2 and 3 Camden Row comprising: repair and reinstatement of original shop fronts at No 92 Camden Street Lower and No. 1 Camden Row, including replacement signage to the public house; reinstatement of original lime render at No. 3 Camden Row; the removal of the shopfront at No. 2 Camden Row and; the repair and cleaning of the original brickwork; 

(ix) All associated and ancillary works, including site development works and repairs to existing structures.

