PROTECTED STRUCTURE: A three storey extension to the rear and alterations to the existing dwelling at no. 47 Dartmouth Square (East), Ranelagh, Dublin 6, a Protected Structure, on a site of approx. 300 sq.m. The development will consist of the following principal elements:
Removal of a two-storey rear annexe (9.4 sq.m) and a single-storey rear extension (20.3 sq.m); the construction of a part single (34.7 sq.m), part two-storey (15.9 sq.m) and part 3-storey (4.6 sq.m) extension to the rear (55.2 sq.m total): Rear elevation changes as well as internal modifications on the ground, first floor and first floor return to the existing dwelling. These will include the enlargement of existing opes, as well as the creation of new and removal of existing non-original  partitions on the second floor within the existing house; 
Enlargement and replacement of the existing rooflight over the stairwell; replacement of two existing rooflights in the attic and provision of new rooflight over master ensuite - all rooflights located on inner roof pitches (not visible from ground); 
Removal of existing non-original single-glazing and replacement with slim double-glazed units into existing non-original sashes in original frames;
Reconfiguring of the garden level terrace and bin storage area at front of the existing house. 
The overall development will include all associated site development and landscaping works and all conservation and repair work.

PROTECTED STRUCTURE: Planning permission is sought by the Dental Council for development at 57 Merrion Square, Dublin 2, a Protected Structure. The development will consist of the general refurbishment and conservation works to the existing Dental Council offices located in the basement, ground and part of the first floor of the main house and the three floors of the return. The upper floors of the building are in separate tenancy and do not form part of their proposed works. The conservation works will include the following: 
Main house: - 
Minor modifications to internal layout including removal of non-original partitions and doors;
Repair and refurbishment of the sash windows;
Replacement of non-original glazed screens and double doors;
Replacement of the basement front entrance door;
Upgrade of the existing services including the replacement of electric heating system with gas heating system (boiler located in the return);
Removal of redundant cables throughout;
Installation of wheelchair platform-stairs lift to level change in ground floor;
Replacement of doors to the staircase with replica fire doors,
Fire proofing works to existing floors;
Cleaning and localised repair of existing fireplaces;
Localised repair and repointing of existing brickwork to front elevation;
Repointing of front steps;
Removal of paint from stone in front elevation;
Localised repairs and paint to front railing;
Refurbishment of main entrance door.
Return: -
Removal of existing partitions and construction of new partitions to revised WC and kitchen facilities layouts;
New changing room with shower in the basement;
New external wall insulation to existing sand & cement rendered walls;
Replacement of non-original windows and doors with painted timber windows;
New external double door in place of existing window;
Repairs and upgrade of existing flat roof and removal of water tank;
Construction of new parapet;
New water tank relocated to front cellar below pavement.
Courtyard garden: -
New courtyard garden to rear occupying 1/3 of the existing car park and reducing the car parking spaces from 10 to 6.
New rendered wall to separate garden from car park.

Planning permission for the following works: 
1) A new shopfront with appropriate signage, concealed roller shutters and retractable awnings; 
2) Installation of a new wall clock on the Meath Street facade; 
3) Partial change of use of the ground floor from retail use to coffee shop use; 
4) Renovation of the existing Meath Street facade to include a new painted render wall finish and also alterations to the existing window arrangement with the installation of new replacement windows; 
5) All associated site works.

The proposed amendments include the following: (i) Provision of an additional sub-basement area of 1,025 sq.m gross floor area (GFA) to accommodate a gym ancillary to the permitted office use, and plant room areas, and details of attenuation tank provided;
(ii) omission of two previously permitted entrances and the creation of a single central entrance and foyer and associated elevation amendments;
 (iii) increased building setback along the south-east elevation and increased terrace area at lower ground floor level and consequential elevation amendments to the south-east elevation;
 (iv) Omission of the two previously permitted cores and provision of one central core. Omission of the permitted single atrium and replacement with two atriums either side of the central core. All associated amendment at each floor level as a result of the alterations to the atrium and cores; 
(v) alterations to the internal layout of the lower basement; (vi) Alterations to the south-west , north-east and north-west elevations. 
(vii) Relocation of bridge / walkway from upper basement level to ground floor level within the south-west part of the site; 
(viii) Amendments to external landscaping design at ground floor level, including amendments to the tree protection zone;
 (ix) Relocation of the approved building footprint closer to the western and south-western site boundary; and 
(x) All other associated and ancillary amendments as depicted on the application drawings. The proposed amendments result in an overall increase in the gross floor space from 22,815 sq.m in the permitted development to 24,398 sq.m (including proposed sub-basement area) which is a total increase of 1,583 sq.m.

Planning permission for a residential and commercial development at the former CIE Lands, Carnlough Road, Cabra, Dublin 7 to include the demolition of No.'s 2 & 4 Carnlough Road. The proposed development will consist of 387 no. apartments and 2,965 sq.m. GFA of commercial floor space The proposed scheme will consist of the following: Block A - 4 storey building comprising 63 no. apartments at first to third floor levels inclusive (18 no. 1 bed, 42 no. 2 bed & 3 no. 3 bed) with balconies/terraces to east, south and west elevations; 1 no. creche (535 sq.m.), 1 no. convenience retail supermarket (1,651 sq.m.), a security/management room (61 sq.m.), maintenance store (30 sq.m.), ESB substation, and 2 no. retail units (145 sq. m. & 340 sq.m.) all at ground floor level; Block A3 - 1 no. retail unit (129 sq.m.) at ground floor level and 1 no. office/commercial unit (165 sq.m.) at first floor level; 
Block B, D, E, G & H - 4 storey buildings each comprising 34 no. apartments (7 no. 1 bed, 22 no. 2 bed & 5 no. 3 bed) with balconies/terraces to north, east and south elevations;Block C - 4 storey building comprising 40 no. apartments (4 no. 1 beds; 28 no. 2 beds; 8 no. 3 beds) with balconies/terraces to all elevations; Block F - 4 storey building comprising 52 no. apartments (4 no. 1 beds, 36 no. 2 beds & 12 no. 3 beds) with balconies/terraces to all elevations; 
Block J - 4 storey building comprising 40 no. apartments (32 no. 2 beds & 8 no. 3 beds) with balconies/terraces to all elevations; 
Block K - 4 storey building comprising 22 no. apartments (18 no. 2 beds & 4 no. 3 beds) with balconies/terraces to north, east and south elevations. A basement consisting of 679 no. car parking spaces, 387 no. bicycle parking spaces, waste storage areas, general storage areas and plant areas. 7 no. car parking and 60 no. bicycle parking spaces will also be provided at surface level. A new vehicular entrance will be provided from Carnlough Road, which will be facilitated by the demolition of No.'s 2 & 4 Carnlough Road and an upgraded junction between Cabra Road and Carnlough Road. The proposed development will also provide for a new pedestrian entrance to Fassaugh Avenue, 2 no. new ESB substations and switch rooms at surface level, pump room and all associated ancillary landscaping, play areas, boundary treatment , engineering and site development works.

Planning permission for minor amendments to Reg Ref: 4071/09 for a mixed use development at a 0.4223 hectare site at 1-4 Windmill Lane, 1-3 Hanover Street East and No's 19-20 Creighton Street, Dublin 2. The proposed amendments to the permitted development comprise of the following: Amendments to structural grid and core layout and associated elevational and internal layout amendments, including introduction of 1 no. additional fire escape stairs; 
Reconfiguration of internal lightwell to the east; 
Amendments to entrance feature to Windmill Lane, including provision of double height entrance feature and amendments to cantilevered entrance canopy; 
Relocation of ramped entrance to basement car park from Hanover Street East; 
Provision of fire escape stairs to rear of No. 19 Creighton Street on Creighton Street elevation; 
Omission of permitted new graffiti wall to Windmill Lane and provision of ventilation grilles at ground floor level to Hanover Street East and Windmill Lane; 
Omission of service lane to the east and re-location of ESB sub-station to Hanover Street East; 
All associated and ancillary works. 
The proposed amendments result in a minor increase in the gross office floor space of the development, of 147 sq.m from 13,980 sq.m of office space to 14,127 sq.m of office space. There are no amendments proposed to the permitted residential or retail floor space.

The development will consist of amendments to the previously granted development under planning ref .4274/05 (as extended in duration under planning ref .4274/05x1) for the partial demolition and reconstruction of a partially collapsed building,for science and technology uses.The proposed amendments comprise the extension of the permitted building along with associated external and internal changes. External alterations and tensions comprise
(1) an increased depth and width of the permitted building to increase the permitted floor area of 155.53 sq.m(82.94 sq.m at ground floor level and 72.59 sq.m at first floor level) to a gross floor area of 306.4sq.m (comprising 26.2sq.m of additional floor area at ground floor, plus the amalgamation of 127sq.m of existing ground floor storage area with the new ground floor area,and an additional 80.3 sq.m of floor area at first floor level);
