F) 5 level link building with lift access/ stairwell;
G) basement with plant room, laundry;
H) waste management store/ covered service vehicle temporary parking bay off Protestant Row;
I)covered bicycle store;
J) landscaped private open space.
The total gross floor area of the proposed structures is c. 1445 sq.m. The gross floor area of the existing building proposed to be altered/ changed from retail/ related storage use to student accommodation management/ reception area is c. 30 sq.m.

