PROTECTED STRUCTURE: Hibernia Reit Plc, intend to apply for a 10 year planning permission for development at a 0.51 hectare site located at Harcourt Square, Harcourt Street and Charlotte Way, Dublin 2 and including No. 40 Harcourt Street (a Protected Structure).

 The proposed development comprises of Phase 1 of the redevelopment of the site and consists of the following:

- Demolition of existing buildings on the site and part of the existing wall to Charlotte Way. No. 40 Harcourt Street will be retained; The development of an office development of seven storeys, with setbacks at fifth, sixth and seventh storeys, above 2 no. basement levels. Roof terraces are provided at third floor level to the east elevation, fourth floor level to the west and east elevation, at fifth floor level at the west elevation, and at sixth floor level at north, east and west elevations. Plant enclosures and a green roof will be provided at roof level;

- The removal of the existing link to the rear of No. 40 Harcourt Street and the provision of a replacement glazed link to the new development to connect to No. 40 at first, second, and third floor levels; 
- Provision of a landscaped open space area to Harcourt Street;

- Removal of the existing vehicle southern entrance/exit point from Harcourt Street and the provision of a new vehicular access from Harcourt Street to basement levels to serve the Phase 1 development and the retained adjoining Block 1. The proposed   basement level to serve the Phase 1 development will provide 38 no. car parking spaces, 153 bicycle parking spaces (plus 10 no. spaces at surface level), shower, changing and locker facilities, loading bays, plant areas, waste storage and other ancillary   areas; 

- The development includes all associated site development works, hard and soft landscaping and all other ancillary works. 

The proposed development comprises of a total gross floor space of circa 15,274 sq.m, including 978 sq.m gross office space in the retained No. 40 Harcourt Street.

