PROTECTED STRUCTURE: The proposed mixed-use redevelopment will consist of:-
- Construction of a 4 star, 181 bedroom hotel ranging from 5-6 storeys over basement, with associated business facilities, restaurant and hotel cafe / bar and fitness suite, roof terrace to 4th floor setback at Charlemont Mall, vehicular access from Charlemont Street and service vehicle access from Charlemont Mall;
