- Partial demolition of No. 36 at ground and basement level to provide vehicular access ramp to basement car park;
- Refurbishment of No. 37 Charlemont Street (Protected Structure) including demolition of 20th century wing and change of use from medical clinic to hotel lounge at ground floor with bedrooms at first and second floor;
- Works to the Protected Structure shall include demolition of non-original bay window; removal of non-original partition walls; installation of removable partition walls; formation of new ope in south-east elevation; installation of partitions, doors and window screens to comply with fire regulations; reinstatement of parapets to front and rear elevations; connection of new atrium rooflight structure to parapet;
